import skillsbackgroundimage from '../assets/skills.jpg';

function Skills() {
  return (
    <div className="skills">
      <img className="first__background" src={skillsbackgroundimage} alt="Main" />
      <div className="container">
        <div className="title">
          <div className="heading">
            <p>Skills</p>
          </div>
        </div>
        <div className="skills_block">
          <div className="column column--first"></div>
          <div className="column column--second"></div>
          <div className="column column--third"></div>
        </div>
        <div className="btn btn--second">View CV</div>
      </div>
    </div>
  );
}

export default Skills;
